INSERT INTO `organism` (`organism_id`, `scientific_name`, `common_name`, `local_name`, `subfamily_id`, `organism_description`, `population`, `indigenous`, `cultivated`, `endangered`, `medicinal`, `benefits`, `dangerous`, `threats`, `opportunities`, `photo`, `links`, `food_name`, `food_description`, `isvalidated`, `inserted_on`, `updated_on`) VALUES
(5, 'Arabian leopard', 'Arabian leopard', 'Arabian leopard', 7, 'The Arabian leopard (Panthera pardus nimr) is a leopard subspecies native to the Arabian Peninsula and classified as Critically Endangered by IUCN since 1996. Fewer than 200 wild individuals were estimated to be alive in 2006. The population comprises fewer than 250 mature individuals and is severely fragmented. Subpopulations are isolated and not larger than 50 mature individuals. The population is thought to decline continuously.The Arabian leopard is the smallest leopard subspecies. It was tentatively affirmed as a distinct subspecies by genetic analysis from a single captive leopard from Israel of south Arabian origin, which appeared most closely related to the African leopard. ', '88', 1, 0, 1, 0, 'Habitat destruction and prey depletion caused by unregulated hunting are probably the two main threats to the Arabian leopard throughout its range. Prey depletion leads to livestock depredation and retaliatory killing of leopards by angry pastoralists. Another major threat is posed by trapping for the illegal wildlife trade. This is particularly true of the Yemeni population as Yemen is a poor nation surrounded by wealthy countries in which animal collecting is fashionable. ', 'Habitat destruction and prey depletion caused by unregulated hunting are probably the two main threats to the Arabian leopard throughout its range. Prey depletion leads to livestock depredation and retaliatory killing of leopards by angry pastoralists. Another major threat is posed by trapping for the illegal wildlife trade. This is particularly true of the Yemeni population as Yemen is a poor nation surrounded by wealthy countries in which animal collecting is fashionable. ', 'Habitat destruction and prey depletion caused by unregulated hunting are probably the two main threats to the Arabian leopard throughout its range. Prey depletion leads to livestock depredation and retaliatory killing of leopards by angry pastoralists. Another major threat is posed by trapping for the illegal wildlife trade. This is particularly true of the Yemeni population as Yemen is a poor nation surrounded by wealthy countries in which animal collecting is fashionable. ', 'Habitat destruction and prey depletion caused by unregulated hunting are probably the two main threats to the Arabian leopard throughout its range. Prey depletion leads to livestock depredation and retaliatory killing of leopards by angry pastoralists. Another major threat is posed by trapping for the illegal wildlife trade. This is particularly true of the Yemeni population as Yemen is a poor nation surrounded by wealthy countries in which animal collecting is fashionable. ', , 'file:///C:/Users/Tom/Documents/GitBioDiversity_Oman/ProjectOman/Webpages/webpage-ArabianLeopard.html', '', '', 1, '2015-03-08', NULL);
INSERT INTO `organism` (`organism_id`, `scientific_name`, `common_name`, `local_name`, `subfamily_id`, `organism_description`, `population`, `indigenous`, `cultivated`, `endangered`, `medicinal`, `benefits`, `dangerous`, `threats`, `opportunities`, `photo`, `links`, `food_name`, `food_description`, `isvalidated`, `inserted_on`, `updated_on`) VALUES
(6, 'Oryx leucoryx', 'Arabian white oryx', 'Arabian white oryx', 8, 'The Arabian oryx (Oryx leucoryx) or white oryx is a medium-sized antelope with a distinct shoulder bump, long, straight horns, and a tufted tail. It is a bovid, and the smallest member of Oryx genus, native to desert and steppe areas of the Arabian Peninsula. The Arabian oryx was extinct in the wild by the early 1970s, but was saved in zoos and private preserves and reintroduced into the wild starting in 1980.It is strange to think of a large mammal capable of living in intensely hot desert conditions, but the Arabian oryx shows us how successful they can be. This herbivore has a white coat to reflect the sunlight of the day, while its dark legs help absorb heat during cold desert mornings. It can sense rain over long distances and so can find fresh grasses and plants, and will even eat roots when no other forage is available. It feeds during dawn and late afternoon, resting in shaded areas during the mid-day heat. As for water, the Arabian oryx can go for days, and sometimes even weeks without a significant drink, finding enough water by drinking dew that has formed on the plants it eats or from the water content of plants themselves. ', 'unknown', 1, 0, 1, 0, 'Arabian oryx shows us how successful they can be. This herbivore has a white coat to reflect the sunlight of the day, while its dark legs help absorb heat during cold desert mornings. It can sense rain over long distances and so can find fresh grasses and plants, and will even eat roots when no other forage is available. It feeds during dawn and late ', '', 'Threats:\r\nThe greatest threats affecting the Arabian oryx are human-related and include habitat loss and their being hunted for the meat, hides and horns their bodies provide.\r\nFun fact:\r\nThe mythical unicorn may have originated in part from the Arabian oryx, which can appear to have only one horn when seen in profile. An alternative origin of the mythical one-horned unicorn may have been from sightings of an injured oryx; Aristotle and Pliny the Elder held that the oryx was the unicorn''s "prototype". From certain angles, the oryx may be mistaken as having one horn instead of two, and given that its horns are made from hollow bone which cannot be regrown, if an oryx were to lose one of its horns, for the rest of its life it would have only one horn.', '', , 'file:///C:/Users/Tom/Documents/GitBioDiversity_Oman/ProjectOman/Webpages/webpage-ArabianWhiteOryx.html', 'gras', '', 1, '2015-03-09', NULL);
INSERT INTO `organism` (`organism_id`, `scientific_name`, `common_name`, `local_name`, `subfamily_id`, `organism_description`, `population`, `indigenous`, `cultivated`, `endangered`, `medicinal`, `benefits`, `dangerous`, `threats`, `opportunities`, `photo`, `links`, `food_name`, `food_description`, `isvalidated`, `inserted_on`, `updated_on`) VALUES
(7, 'Capra nubiana', 'Nubian Ibex', 'Nubian Ibex', 9, 'Unknown', 'unknown', 1, 0, 1, 0, '', 'Are you going on a schooltrip or on vacation with your parents? Let us know if you have seen this beautiful critter and send us your pictures. Perhaps we''ll use your holiday pictures in our next exhibition! Have fun, but be carefull and never approach this animal in the wild!', 'Competition with livestock, camels and feral donkeys is a general threat throughout the range. High levels of tourists at watering, feeding and birthing sites also threatened the population in Israel (Alkon 1997). Hunting is a threat to the species throughout its range. Habitat loss and degradation threatens the species in much of its range. Some predation by leopards (Panthera pardus) has been reported in Israel, and reproductive success and juvenile survival vary from year to year, probably depending largely on the nutritional status of adult females. No significant effects of parasites or diseases have been detected among wild populations.', '', , '', '', 'The Nubian Ibex is a herbivore. This means that he (or she) mainly eats plants, herbs, bark, fruit and even flowers!', 1, '2015-03-09', NULL);
